INSERT INTO `notice` VALUES (1,4,'业务暂停通知','因个人事务等，宠物医院停业一天，万分歉意','2021-09-23 22:58:34','2021-09-23 22:58:36'),(2,1,'宠物医院规章制度','1、所有员工必须热爱定物。\n2、以“关爱；诚信”为准则，并且为宠物急所急。\n3、按时上下班，遵守上下班制度。\n4、工作时，注意自己的言谈举止，使用文明用语。\n5、工作时间暂时定为 8：30~22：00,上班时间．保证衣着整洁。\n6、8: 30~9：00 由负责人对每日或前一日工作进行安排或总结。\n7、上下班或交接班时，必须将自己的工作区清理干净。\n8、按事先的排班时间表进行有序工作，不影响工作的情况下自行调整。','2021-09-21 15:47:13','2021-09-21 15:47:26'),(3,4,'修改标题1','修改描述1','2021-09-21 00:00:00','2021-09-22 00:00:00');

